import api from './api';

export const getAllCurrencies = (): Promise<T> => api.get('/latest?base=UAH');

export const getCurrency = (fromCurrency: string, toCurrency: string): Promise<T> =>
  api.get(`/convert?from=${fromCurrency}&to=${toCurrency}`);
